import { Component, OnInit } from '@angular/core';
import { Storage } from '@ionic/storage';
import { Camera, CameraOptions } from '@ionic-native/Camera/ngx';
import { Crop } from '@ionic-native/crop/ngx';
import { File } from '@ionic-native/file/ngx';
import { ModalController, ActionSheetController } from '@ionic/angular';
import { ProgramationPage } from '../programation/programation.page';

@Component({
	selector: 'app-showcase',
	templateUrl: './showcase.page.html',
	styleUrls: ['./showcase.page.scss'],
})

export class ShowcasePage implements OnInit {

	base = "data:image/png;base64,";
	/* rows: any[] = [{ "placeholder": "Texto 1 <br>No te dejes engañar por su tamaño, son muy sabrosos y versátiles. Añádelos a tus ensaladas o como complemento", "img": "", "text": "" }]; */
	slider: any[] = [];
	rows: any[] = [{ "img": "", "ingredients": "", "subtitle": "" }];
	title;
	subtitle;

  	constructor(
		private actionSheetController: ActionSheetController,
		private modalCtrl: ModalController,
		private storage: Storage,
		private camera: Camera,
		private crop: Crop,
		private file: File
	) {}

	ngOnInit() {}

	async selectImage(type) {
		const actionSheet = await this.actionSheetController.create({
			header: "Select Image source",
			buttons: [
				{
					text: 'Cargar imagen',
					handler: () => {
						this.addslider(this.camera.PictureSourceType.PHOTOLIBRARY, type);
					}
				},
				{
					text: 'Tomar foto',
					handler: () => {
						this.addslider(this.camera.PictureSourceType.CAMERA, type);
					}
				},
				{
					text: 'Cancelar',
					role: 'cancel'
				}
			]
		});
		
		await actionSheet.present();
	}
	  
	async addslider(sourceType, type) {
		const options: CameraOptions = {
			allowEdit: false,
			quality: 100,
			sourceType: sourceType,
			destinationType: this.camera.DestinationType.FILE_URI,
			encodingType: this.camera.EncodingType.JPEG,
			mediaType: this.camera.MediaType.PICTURE,
			correctOrientation: true,
		}

		this.camera.getPicture(options).then( imageData => {
			this.cropImage(imageData).then( newImage => {
				this.imageToBase64(newImage.split('?')[0]).then( base64 => {
					let base64Image = 'data:image/jpeg;base64,' + base64;
					if(type == 'slider') {
						this.slider.push(base64Image);
					} else {
						this.rows[type].img = base64Image;
					}
				});
			});
		}, (err) => {
			console.error(err);
		}).catch( error => { 
			console.error(error);
		});
	}

	async cropImage(imageData) {
		return new Promise<any>((resolve, reject) => {
			this.crop.crop(imageData, { quality: 100 }).then( newImage => { 
				resolve(newImage);
			}, error => { 
				reject(error);
			});
		});
	}

	async imageToBase64(newImage) {
		return new Promise<any>((resolve, reject) => {
			var copyPath = newImage;
			var splitPath = copyPath.split('/');
			var imageName = splitPath[splitPath.length-1];
			var filePath = copyPath.split(imageName)[0];

			this.file.readAsDataURL(filePath,imageName).then (base64=>{
				var base = base64.split(';base64,')[1];
				resolve(base);
			}, error=>{
				reject(error);
			});
		});
	}

	async deleteSlider(index) {
		var array = this.slider;
		var array2 = array.splice(1, index);
		this.slider = array2;
	}

	async addNewRow() {
		var length = this.rows.length + 1;
		var a = { "img": "", "ingredients": "" }
		this.rows.push(a);
	}

	async goToProgramation() {
		/* if(this.slider.length < 1) {

		}

		if(this.rows.length < 1) {

		}

		if(!this.title) {

		}

		if(!this.subtitle) {

		}

		if((this.title) && (this.subtitle) && (this.slider.length > 0) && (this.rows.length > 0)) { */
			var arr = [];

			this.rows.forEach( row => {
				var a = { "img": row.img, "ingredients": row.ingredients, subtitle: this.subtitle };
				arr.push(a);
			})

			this.rows = arr;

			const modal = await this.modalCtrl.create({
				component: ProgramationPage,
				cssClass: 'modal-fullscreen',
				componentProps: {
					title: this.title,
					subtitle: this.subtitle,
					rows: this.rows,
					slider: this.slider
				}
			});
	
			await modal.present();
		/* } */
	}
}